import { MutatingDots } from 'react-loader-spinner';
export const ChatOutput = (props) => {
    console.log("props here");
    console.log(props);
    const userInput = props.message.userInput.split('-');
    const serverResponse = props.message.serverResponse.split('-');
    return (
        <div className="chatoutput">

            <div className="chat-message">

                {userInput.map((input, index) => {
                    const serverResponseValue = serverResponse[index];
                    return (
                        <div>
                            <div className="flex items-end justify-end">
                                <div className="flex flex-col space-y-2 text-xs max-w-xs mx-2 order-1 items-end">
                                    <div><span className="px-4 py-2 rounded-lg inline-block rounded-br-none bg-blue-600 text-white "> {userInput}  </span></div>
                                </div>

                            </div>
                            <div className="flex items-end">
                                <div className="flex flex-col space-y-2 text-xs max-w-xs mx-2 order-2 items-start">
                                    <div><span className="px-4 py-2 rounded-lg inline-block rounded-bl-none bg-gray-300 text-gray-600">{serverResponse === "loading" ? (
                                        <div><MutatingDots /></div>
                                    ) : (
                                        serverResponseValue
                                    )} </span></div>
                                </div>
                            </div>

                        </div>
                    )

                })}

            </div>

        </div>
    )
}
